Как принимать Amino 2222 Tabs (Caps)
Производитель рекомендует принимать аминокислотный комплекс 3 раза в день, одна порция добавки это 2 таблетки (или капсулы), то есть, как минимум вы должны употреблять по 6 таблеток в сутки. Если вы занимаетесь бодибилдингом профессионально и выступаете на соревнованиях, то можете увеличивать дозировки в три раза – 18 таблеток в сутки.
Принимать Superior Amino 2222 (Caps/Tabs) от Optimum Nutrition рекомендуется за полчаса до тренировки, во время тренинга и сразу после занятия, такого режима приема стоит придерживаться в тренировочные дни. В дни отдыха нужно употреблять 1 порцию утром, и еще 2 между приемами пищи. Эффективность комплекса увеличится, если его принимать вместе с другими добавками (протеином, гейнером, креатином). Таблетки или капсулы нужно запивать большим количеством жидкости (более 250мл).
