Описание налобного фонаря Fenix HL23 Cree XP-G2 R5:
Фонарь Fenix HL23 работает на основе американского светодиода Cree XP-G2 R5 с рабочим потенциалом в 50 000 ч. Он дает свет яркостью до 150 люмен и позволяет фонарю светить в трех различных режимах. В зависимости от ситуации и потребностей в освещении, доступны режимы с яркостью света 3 люмена, 50 люмен и 150 люмен. Во время работы каждого из них, задействован контроллер, повышающий напряжение. Это значит, что когда батарейка начинает подсаживаться, яркость фонаря останется на прежнем уровне до тех пор, пока на ее поддержание будет достаточно заряда электричества. Также в данной модели использован механизм интеллектуальной памяти фонаря. При включении он начнет работу с того режима яркости, который последним был активным во время прошлого сеанса.
Аккумуляторный отсек модели Fenix HL23 вмещает в себя один элемент питания типа АА. Его заряда может быть достаточно для работы в экономном режиме яркости в течение 110 ч для щелочной батарейки или 100 ч для аккумулятора . Но данный показатель напрямую зависит от качества и емкости аккумулятора.
Дистанция освещения для фонаря Fenix HL23 достигает 55 м в режиме яркости High. Этого вполне достаточно, чтобы создать комфортное освещение в полевых условиях. Более экономные режимы могут быть использованы для локального освещения внутри палатки и в других подобных ситуациях. Кстати говоря, для использования в профессиональных целях налобный фонарь тоже является одним из незаменимых аксессуаров. Его удобно использовать при работе с электрикой, сантехникой, ремонте компьютерной техники. Так что в арсенале домашнего мастера или профессионала, фонарь Fenix HL23 займет достойное место.
Корпус фонаря Fenix HL23 — алюминиевый. Он служит надежным барьером для пыли, грязи, влаги, а также оберегает фонарь от поломок из-за ударов. Поверхность корпуса покрыта анодированием, которое дополнительно оберегает его от появления царапин. В данной модели фонаря корпус отлично изолирован, благодаря чему Fenix HL23 успешно прошел сертификацию на высший уровень защищенности IP-68. Это значит, что его можно использовать в любую погоду и даже ронять в ручьи или включать под водою. Правда время погружения рекомендуется ограничить получасом, а глубину — 2 м.
